  [],\n\t\"revision_timestamp\": \"2014-04-24T15:02:49.993993\",\n\t\"name\": \"a-preliminary-contaminant-and-toxicological-survey-of-illinois-river-sediments\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Sediments from 6 sites on the Illinois
  River adn its tributaries were analyzed for organic and inorganic contaminants.
  Relative toxicity of sediments was determined using bioassays. Concentrations of
  contaminnts were extremely high in the Chicago River and declined with increasing
  distance from Chicago. Ammonia appears to be the factor most significantly affecting
  aquatic life, but levels of polynuclear aromatic hydrocarbons and heavy metals are
  of concern. Recommendations for further study and improving water quality are made.\",\n\t\"license_title\":
